                            sg.popup('WhileDGP','Clique em "OK" para fechar esta janela.\nInfo: Caso a informação dos anos que você informou\nnão estejam de acordo com o site, os mais adequados serão escolhidos.\nOu seja, caso os anos que você escolheu for maior que aos do site,\nserá coletados que estão de acordo com o do site.')
                            pesqLinks(values[0], 1, values[1])
